.main {
  height: 100%;
  display: flex;
  flex-direction: column;
  color: #606266;
  .flow-tabs {
    >>> .el-tabs__item {
      text-align: left !important;
      width: 160px !important;
    }
    >>> .el-tabs__content {
      height: 100%;

      .el-tab-pane {
        height: 0;
        display: none !important;
      }
    }
  }
  >>> .is-horizontal {
    display: none;
  }
  >>> .el-scrollbar__view {
    overflow: hidden;
  }
  .box {
    height: 100%;
    display: flex;
    flex-direction: column;
  }
  .list {
    flex: 1;
    padding-top: 10px;
    overflow: hidden auto;
    .item {
      margin-bottom: 20px;
      cursor: pointer;
      >>> .el-card {
        border-radius: 10px;
      }
      >>> .el-card__body {
        display: flex;
        align-items: center;
        padding: 15px;
      }
      .box-icon {
        width: 48px;
        height: 48px;
        border-radius: 10px;
        text-align: center;
        background-color: #ccc;
        display: inline-block;
        margin-right: 15px;
        i {
          text-align: center;
          font-size: 36px;
          color: #fff;
          line-height: 48px;
        }
      }
      .title {
        display: inline-block;
        width: calc(100% - 63px);
        text-overflow: -o-ellipsis-lastline;
        overflow: hidden;
        text-overflow: ellipsis;
        display: -webkit-box;
        -webkit-line-clamp: 2;
        line-clamp: 2;
        -webkit-box-orient: vertical;
        word-break: break-all;
        font-size: 14px;
      }
    }
  }
}
